style":"UNSET","media_overlay_info":null,"preview":null,"product_type":"clips","thumbnails":null,"timeline_pinned_user_ids":[],"upcoming_event":null,"user":{"pk":"20059783113","username":"zuretaddis","id":"20059783113"},"like_count":413,"like_and_view_counts_disabled":false,"boosted_status":null,"boost_unavailable_identifier":null,"boost_unavailable_reason":null,"comment_count":12,"comments_disabled":null,"view_count":null,"id":"3681668464640121988_20059783113"},{"pk":"3674299311319008982","accessibility_caption":null,"caption":{"pk":"18119568550468873","text":"Hailu Mergia: The Return of the Organ Man \ud83c\uddea\ud83c\uddf9\n.\nAfter leaving the army where he first learned to read and arrange music. Hailu Mergia explored various instruments before falling in love with the organ, an instrument almost unknown in Ethiopian music at the time. With a visionary ear, he fused the warm, textured tones of the Hammond organ with traditional Ethiopian scales, becoming one of the first to craft a uniquely Ethiopian sound on the keys. As a founding member of the Walias Band, he helped shape the vibrant nightclub scene of 1970s Addis Ababa and pushed musical boundaries during a golden era. After moving to the U.S. in the early \u201980s, Mergia faded from the spotlight, quietly driving a taxi in Washington, D.C. his keyboard always in the trunk. Decades later, a cassette rediscovered by \u0040awesometapesfromafrica reignited global interest, marking a powerful comeback for a pioneer whose music never stopped evolving.\n.\n.\n.\n.\n\ud83c\udfa5 \u0040faroffsounds \n.\n.\n.\n.\n.\n.\n#zuretaddis #HailuMergia #EthiopianJazz #EthioJazz #AfricanMusic #JazzFusion #WorldMusic #AnalogAfrica #AwesomeTapesFromAfrica #addisababa"},"audience":null,"carousel_media_count":10,"display_uri":"https:\/\/instagram.fadd1-1.fna.fbcdn.net\/v\/t51.2885-15\/518729221_18087450877671114_9130637709094316516_n.jpg?stp=dst-jpg_e15_tt6&_nc_ht=instagram.fadd1-1.fna.fbcdn.net&_nc_cat=106&_nc_oc=Q6cZ2QHUUS8xo 6&_nc_oc=Q6cZ2QHUUS8xoE1HlzrrOa9l7-7SHLjfLJ21E1fnnZbjK-qmBZ9LR4tmE7Uq6WwwzC6PDic&_nc_ohc=FdJmwpqA264Q7kNvwGX4Q8L&_nc_gid=kxvrXvskf1ipGtM5rvm0ag&edm=APs17CUBAAAA&ccb=7-5&ig_cache_key=MzY1NTQyNTU1NTE1ODgwMTU1Nw\u00253D\u00253D.3-ccb7-5&oh=00_AfR6xquAYG-ePSMTDCHCx72NNefwrSpwivlOKt0h7vxbnQ&oe=688A3FE9&_nc_sid=10d13b","width":150}]},"code":"DK6ri_oI79c","media_cropping_info":null,"profile_grid_thumbnail_fitting_style":"UNSET","media_overlay_info":null,"preview":null,"product_type":"carousel_container","thumbnails":null,"timeline_pinned_user_ids":[],"upcoming_event":null,"user":{"pk":"20059783113","username":"zuretaddis","id":"20059783113"},"like_count":651,"like_and_view_counts_disabled":false,"boosted_status":null,"boost_unavailable_identifier":null,"boost_unavailable_reason":null,"comment_count":2,"comments_disabled":null,"view_count":null,"id":"3655425568345931612_20059783113"},{"pk":"3651219949430573473","accessibility_caption":null,"caption":{"pk":"17968439696873435","text":"Emperor Haile Selassie & the Dutch Royals: A Historic Visit \ud83c\uddea\ud83c\uddf9\ud83c\uddf3\ud83c\uddf1\n.\nIn January 1969, the Dutch Royal Family paid a historic visit to Ethiopia. Queen Juliana, Prince Bernhard, Princess Beatrix, and Prince Claus were welcomed in Addis Ababa by Emperor Haile Selassie himself.\n\nThe visit was filled with cultural ceremonies, a grand gala at the Jubilee Palace, and tours of historic sites like the Holy Trinity Cathedral. Their journey extended beyond the capital, with sightseeing trips to Abay Falls, the ancient rock-hewn churches of Lalibela, and the majestic obelisks of Axum. It was a rare moment where two royal worlds met captured in these timeless photographs.\n.\n.\n.\n.\n.\n\ud83d\udcf7 Penta Springs Limited\n.\n.\n.\n.\n.\n#zuretaddis #addisababa #ethiopia #dutch #royal #royalfamily #netherlands #habesha #visit #exploer #1969"},"audience":null,"carousel_media_count":20,"display_uri":"https:\/\/instagram.fadd1-1.fna.fbcdn.net\/v\/t51.2885-15\/503993 0_n.jpg?stp=c3.0.979.979a_dst-jpg_e35_s240x240_tt6&efg=eyJ2ZW5jb2RlX3RhZyI6IkNBUk9VU0VMX0lURU0uaW1hZ2VfdXJsZ2VuLjk4Nng5Nzkuc2RyLmY3NTc2MS5kZWZhdWx0X2ltYWdlLmMyIn0&_nc_ht=instagram.fadd1-1.fna.fbcdn.net&_nc_cat=106&_nc_oc=Q6cZ2QHUUS8xoE1HlzrrOa9l7-7SHLjfLJ21E1fnnZbjK-qmBZ9LR4tmE7Uq6WwwzC6PDic&_nc_ohc=kp3kfbLXmD8Q7kNvwHpmfoV&_nc_gid=kxvrXvskf1ipGtM5rvm0ag&edm=APs17CUBAAAA&ccb=7-5&ig_cache_key=MzY0MTExMDIzOTU5NTU5MjIyMQ\u00253D\u00253D.3-ccb7-5&oh=00_AfQEq8NCXIS0El4ZiUnL2ed7kH6QLBaoW76Ji4WzYqtLRQ&oe=688A3B16&_nc_sid=10d13b","width":240},{"height":150,"url":"https:\/\/instagram.fadd1-1.fna.fbcdn.net\/v\/t51.2885-15\/500391546_18083368480671114_8018781163870073740_n.jpg?stp=c3.0.979.979a_dst-jpg_e35_s150x150_tt6&efg=eyJ2ZW5jb2RlX3RhZyI6IkNBUk9VU0VMX0lURU0uaW1hZ2VfdXJsZ2VuLjk4Nng5Nzkuc2RyLmY3NTc2MS5kZWZhdWx0X2ltYWdlLmMyIn0&_nc_ht=instagram.fadd1-1.fna.fbcdn.net&_nc_cat=106&_nc_oc=Q6cZ2QHUUS8xoE1HlzrrOa9l7-7SHLjfLJ21E1fnnZbjK-qmBZ9LR4tmE7Uq6WwwzC6PDic&_nc_ohc=kp3kfbLXmD8Q7kNvwHpmfoV&_nc_gid=kxvrXvskf1ipGtM5rvm0ag&edm=APs17CUBAAAA&ccb=7-5&ig_cache_key=MzY0MTExMDIzOTU5NTU5MjIyMQ\u00253D\u00253D.3-ccb7-5&oh=00_AfSndqcfQTrNrEFgxFN4ohR95EiFRCKzUsHrDC0U1gPB7w&oe=688A3B16&_nc_sid=10d13b","width":150}]},"code":"DKH0nttIdE-","media_cropping_info":null,"profile_grid_thumbnail_fitting_style":"UNSET","media_overlay_info":null,"preview":null,"product_type":"carousel_container","thumbnails":null,"timeline_pinned_user_ids":[],"upcoming_event":null,"user":{"pk":"20059783113","username":"zuretaddis","id":"20059783113"},"like_count":613,"like_and_view_counts_disabled":false,"boosted_status":null,"boost_unavailable_identifier":null,"boost_unavailable_reason":null,"comment_count":5,"comments_disabled":null,"view_count":null,"id":"3641110251306078526_20059783113"},{"pk":"3636739425408464479","accessibility_caption":null,"caption":{"pk":"18086197621632376","text":"\ud83c\uddea\ud83c\uddf9Abebe Bikila: Life Beyond the Finish Line. \n.\nAbebe Bikila\u2019s legacy reaches far beyond his iconic barefoot marathon win at the 1960 Rome Olympics, where he became the first Black African to win Olympic gold. Four years later, he solidified his greatness by winning gold again at the 1964 Tokyo Olympics just 40 days after undergoing an appendectomy. But his most powerful story began after the races were over. On March 22, 1969, while driving a Volkswagen Beetle gifted to him by Emperor Haile Selassie, Abebe was involved in a devastating car accident that left him paralyzed from the waist down. Though his running career ended that day, his determination did not.\n\nRefusing to be defined by his injury, Abebe turned to wheelchair sports. He competed in archery and table tennis at the 1970 Stoke Mandeville Games in London, a precursor to today\u2019s Paralympics. In 1971, he traveled to Norway and remarkably won a cross-country sled dog race. A year later, he was honored with a standing ovation at the 1972 Munich Olympics. Tragically, on October 25, 1973, Abebe passed away at just 41 years old from complications related to his injuries. He was laid to rest with a state funeral attended by over 65,000 people, including Emperor Haile Selassie. \n\nAbebe Bikila was not only a legend on the track he was a symbol of resilience, pride, and the unshakable human spirit.\n.\n.\n.\n.\n.\n.\n.\n.\n.\n.\n#zuretaddis #abebebekila #olympics #athlete #legend #icon #ethiopia #habesha #story"},"audience":null,"carousel_media_count":15,"display_uri":"https:\/\/instagram.fadd1-1.fna.fbcdn.net\/v\/t51.2885-15\/498696914_18082793383671114_5439122721676391394_n.jpg?stp=c1.0.1438.1438a_dst-jpg_e35_s1080x1080_sh0.08_tt6&_nc_ht=instagram.fadd1-1.fna.fbcdn.net&_nc_cat=106&_nc_oc=Q6cZ2QHUUS8xoE1HlzrrOa9l7-7SHLjfLJ21E1fnnZbjK-qmBZ9LR4tmE7Uq6WwwzC6PDic&_nc_ohc=5hDEs0YIqU0Q7kNvwHPPhz9&_nc_gid=kxvrXvskf1ipGtM5rvm0ag&edm=APs17CUBAAAA&ccb=7-5&oh=00_AfQFsxPXppaGf40NjDWGYfoy49I5pdrFME39e2-99nVzUw&oe=688A4B29&_nc_sid=10d13b","media_type":8,"carousel_media":[{"image_versions2":{"candidates":[{"height":1438
